O PRESENTE TERMO DE COMODATO TEM COMO OBJETO A DISPONIBILIZAÇÃO DO(S) SEGUINTE(S) BEM(NS):

01 (UM) SUPORTE PARA O INVÓLUCRO SMS PARA O  GRUPO 1 (ITENS 1 E 2) DESCRITOS NO OBJETO DO TERMO DE REFERÊNCIA;

01 (UM) SUPORTE PARA O INVÓLUCRO SMS PARA O GRUPO 2 (ITENS 3 E 4) DESCRITOS NO OBJETO DO TERMO DE REFERÊNCIA.

1.1 ESTE INSTRUMENTO TEM POR OBJETIVO O FORNECIMENTO DE ENERGIA ELÉTRICA PELA CONTRATADA ÀS UNIDADES CONSUMIDORAS DE RESPONSABILIDADE DO CONTRATANTE, SOB A CONTRAPRESTAÇÃO DE PAGAMENTO DE FATURA DE ENERGIA ELÉTRICA MENSAL, E, DE ACORDO COM AS REGRAS ESTABELECIDAS NA
LEGISLAÇÃO PARA A PRESENTE PRESTAÇÃO DE SERVIÇO PÚBLICO, SEM PREJUÍZO DAS CONDIÇÕES ORA PACTUADAS;
1.2 CADA UNIDADE CONSUMIDORA TERÁ UM CONTRATO ESPECÍFICO DE ACORDO COM A CARGA, TENSÃO, CLASSE E TARIFA, QUE PASSARÁ A FAZER PARTE INTEGRANTE DESTE INSTRUMENTO, NO MOMENTO DA LIGAÇÃO E EXCLUÍDA NO MOMENTO DO DESLIGAMENTO DEFINITIVO E DA REGULARIZAÇÃO FINANCEIRA DA CONTRAPRESTAÇÃO;
1.3 A CONTRATADA FORNECERÁ ENERGIA ELÉTRICA PARA A(S) UNIDADE(S) CONSUMIDORA(S) PERTENCENTE(S) AO PARCEIRO DE NEGÓCIOS NO: 3000729533 (C/C 7001552516);
1.4 A PRESENTE CONTRATAÇÃO DECORRE DE DISPENSA DE LICITAÇÃO, FUNDAMENTA-SE NO ART. 24, INCISO XXII, DA LEI NO 8.666/1993.
